description:
Alison Rey is studying hard for an upcoming Anatomy exam. She has a system in which she rewards herself with milk and cookies for a job well done. When Ryan, her pervy neighbor, get's a glimpse of what she's doing, he fantasizes about teaching her things that she won't find in a book.

